import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'

createApp(App).use(store).use(router).mount('#app')

let icon = document.getElementById('icon');
let iconlnkdn = document.getElementById('iconlnkdn');
let iconmail = document.getElementById('iconmail');
let logo = document.getElementById('logo');

icon.onclick = function () {
    document.body.classList.toggle("darktheme");
    if(document.body.classList.contains("darktheme")){
        icon.src = "data:image/png;base64,";
        iconmail.src = "data:image/png;base64,";
        iconlnkdn.src = "data:image/png;base64,";
        logo.src = "/img/faviconwhite.b28e3e64.png";
    }
    else{
        icon.src = "data:image/png;base64,";
        iconmail.src = "data:image/png;base64,";
        iconlnkdn.src = "data:image/png;base64,";
        logo.src = "/img/favicon.883f9e4f.png";
    }
}